INSERT INTO `category` (`cid`, `muni`, `ttype`, `category`, `daterange`, `remarks`, `stat`, `cDate`) VALUES
(86, 'bulusan', 'ACTIVITY REPORT', 'N/A', '2020-03-03 12:00 / 2020-03-03 16:24', 'N/A', '0', '2020-03-10 09:18:28'),
(87, 'bulusan', 'ACTIVITY REPORT', 'N/A', '2020-03-03 12:00 / 2020-03-03 18:30', 'N/A', '0', '2020-03-10 09:18:28'),
(88, 'sorsogon', 'ACTIVITY REPORT', 'Sorsogon City COVID-19 Inter Agency Task Forc', '2020-03-14 00:00', '* set-up inter agency checkpoint against covid-19\r\n* the task force is composed of CHO, PNP, CDRRMO, TMECS and Phil. \r\n   Army\r\n* conducted thermal scanning of passengers from all vehicles entering \r\n   the border of Sorsogon City.\r\n* Records names, address, point of origin and destination of all \r\n   passengers of cargo, PUV and private vehicles.\r\n', '0', '2020-03-23 06:37:21'),
(89, 'sorsogon', 'ACTIVITY REPORT', 'SITREP on Covid-19 Inter Agency Task Force ', '2020-03-24 12:00', '* continues monitoring of vehicles and passengers on border \r\n   checkpoints.\r\n* infoblast  covid-19 updates to all Barangay.\r\n* Siren warning at 2100h for the start of curfew.\r\n* Siren warning at 0500h for the end of curfew.\r\n* ECQ checking of all vehicles and person at the downtown area of the \r\n   City and all Barangay  boundary.', '0', '2020-03-24 01:57:43'),
(90, 'sorsogon', 'ACTIVITY REPORT', 'SITREP: Sorsogon City Covid-19 Task Force', '2020-03-24 12:00', '* continuous disinfection of main road w/in downtown area conducted \r\n   by BFP.\r\n* CHO sanitation team conducts sanitation to all critical infrastructures \r\n   and  commercial establishments.\r\n* continues distribution of relief goods to all barangays of Sorsogon City.', '0', '2020-03-24 10:28:56'),
(91, 'sorsogon', 'ACTIVITY REPORT', 'SITREP: Sorsogon City COVID-19 Task Force', '2020-03-25 12:00', '* continues conduct of  24/7  checkpoint at the boundary of Sorsogon \r\n   and Castilla at Brgy Salvacion and Sorsogon, Casiguran and Gubat in \r\n    Brgy. Abuyog.\r\n* continued flushing of roads, sidewalks, and checkpoint areas \r\n   conducted by BFP .\r\n* misting and disinfecting of public market, supermarket, groceries and \r\n   other critical critical infrastructures.\r\n* continued distribution of relief goods to the barangays.\r\n* text blast covid 19 updates to the barangays .', '0', '2020-03-25 11:39:59'),
(92, 'sorsogon', 'ACTIVITY REPORT', 'Sorsogon City Covid-19 Inter Agency Task Forc', '2020-03-27 12:00', '* continues conduct of inter-agency checkpoint at Brgy. Salvacion, West \r\n   District, Brgy. Abuyog East District and Brgy. Poblacion Bacon Dist.\r\n* continues daily flushing and disinfecting of roads, establishments and \r\n   other critical infrastructures conducted by the BFP and City Health \r\n   Sanitation Team.\r\n* checking of ECQ and food pass to all vehicles and other pedestrians \r\n   conducted by the PNP, Army and TMECS at the downtown area of \r\n   Sorsogon City. \r\n* Daily monitoring and report gathering from BHERT of all 64 Barangays \r\n   of Sorsogon City.\r\n* daily Text infoblast of Covid-19 updates to all Barangays.', '0', '2020-03-26 23:52:59'),
(93, 'sorsogon', 'ACTIVITY REPORT', 'SITREP: Sorsogon City Covid-19 Inter Agency T', '2020-03-28 12:00', '* on-going 24/7 conduct of checkpoint to AOR boundaries, (Brgy. \r\n   Salvacion West District, Brgy. Abuyog East District, Brgy Poblacion \r\n   Bacon District)\r\n* BFP and CHO conduct flushing and disinfecting in the main \r\n   thoroughfares of downtown Sorsogon and in Bacon District.\r\n* CHO on constant monitoring to all Brgy. BHERT\r\n* at 0200h 28 March 2020 CDRRMO team assisted in the distribution of  \r\n   fish in all the  Barangays of  Bacon District.', '0', '2020-03-28 12:03:40'),
(94, 'sorsogon', 'ACTIVITY REPORT', 'SITREP: Sorsogon City Covid-19 Inter Agency T', '2020-03-30 12:00', '* continues conduct of inter-agency checkpoint at Brgy. Salvacion, Brgy. \r\n  Abuyog and  Brgy Poblacion.\r\n* daily conduct of flushing and disinfecting of major roads, public \r\n   markets and other critical infrastructures within the city.\r\n* daily infoblast to all barangays of Covid-19 updates and other \r\n   information.\r\n* finished delivery of almost 300 large tubs of fish to the 64 barangays \r\n  of Sorsogon City and was distributed by the Brgy. officials in their \r\n  constituents.\r\n', '0', '2020-03-30 00:48:24'),
(99, 'sorsogon', 'ACTIVITY REPORT', 'SITREP: Covid-19 Inter Agency Task Force', '2020-03-31 12:00', '* 24/7 conduct of inter agency checkpoint at Brgy. Salvacion, Brgy. \r\n   Abuyog and Brgy. Poblacion\r\n* continues information dissemination to pedestrians, and to all \r\n    barangays.\r\n* daily text blast of covid-19 updates to all barangays.\r\n* first day of implementation of MERKADO on WHEELS by Mayor Ester \r\n   Hamor, a rolling store w/c  is  selling basic needs to the barangays in a  \r\n   minimal price.\r\n* flushing and disinfection in major thoroughfares in the city and other \r\n   critical infrastructures conducted y the BFP and CHO.\r\n', '0', '2020-03-31 11:25:33'),
(101, 'sorsogon', 'ACTIVITY REPORT', 'SITREP : Sorsogon City Inter-Agency Covid-19 ', '2020-04-03 12:00', '* 24/7 IATF checkpoint in Brgy. Salvacion, Brgy. Abuyog and Brgy. \r\n   Poblacion, \r\n* continues daily flushing and disinfecting of  public market, \r\n   establishments and  main thoroughfares and side streets of downtown \r\n   Sorsogon.\r\n* the City Mayor Ester Hamor issued E.O. no. 16 series of 2020 : AN \r\n  ORDER MANDATING THE COMPULSORY WEARING OF FACE MASK \r\n  IN ALL PUBLIC PLACES  IN THE CITY OF SORSOGON AS A \r\n  PRECAUTIONARY MEASURE AGAINST THE SPREAD OF COVID 19.\r\n* BFP-SRU set-up Decontamination area for the incoming and outgoing \r\n   duty personnels at Brgy. Salvacion checkpoint.', '0', '2020-04-03 11:25:02'),
(102, 'sorsogon', 'ACTIVITY REPORT', 'SITREP : Sorsogon City Covid-19 Inter-Ageny T', '2020-04-05 12:00', '* Sorsogon City Covid 19 update : as of April 5, 2020 : \r\n   403 PUM Ongoing Quarantine \r\n   2,968 PUM Completed Quarantine \r\n   4 PUI Ongoing Quarantine \r\n   77 PUI Completed Quarantine \r\n   ZERO CONFIRMED COVID 19 CASE in Sorsogon City \r\n   source : City Health Office\r\n* daily misting and disinfection of major roads, critical infrastructures\r\n   and other private and government buildings.\r\n* distributed 300 tubs of fish to all East, West and Bacon District \r\n   barangays in the city.\r\n', '0', '2020-04-05 07:44:57'),
(104, 'sorsogon', 'ACTIVITY REPORT', 'SITREP : Sorsogon City Covid-19 IATF', '2020-04-16 12:00', '* 24/7 conduct Inter-agency  checkpoint at Brgy. Salvacion, checking \r\n   ECQ pass, Company I.D., Travel pass of private vehicles and clearances \r\n   for safe passage to Sorsogon City.\r\n* BFP-SRU conducts DECON of vehicles coming from Albay and other \r\n   places with positive Covid-19 cases.\r\n* PNP, TMECS, Phil. Navy Reserve, Phil. Army Reserve conducts \r\n   checking and validation of ECQ pass to all vehicles and private \r\n   individuals going to market and other commercial establishments in \r\n   downtown area.\r\n* Sorsogon City DRRMO conducts patrol and information dissemination \r\n   about Social Distancing, wearing of mask,l  Curfew for minors and \r\n    other important information to all barangays. \r\n* Send daily Covid-19 upadates to all barangays and councils members \r\n   thru Smart Infocast.', '0', '2020-04-15 22:51:58'),
